import {
    RECEIVE_ADDRESS,
    RECEIVE_CATERGORYS
} from './mutations-type'

 export default {
    [RECEIVE_ADDRESS] (state,{address}){
        state.address = address
        console.log( state.address)
    },

    [RECEIVE_CATERGORYS] (state,{catergorys}){
        state.catergorys = catergorys
        console.log( state.catergorys) 
    }
 }
